document.addEventListener("DOMContentLoaded",function(){$("body").on("click",".modal .ai_fill",function(){let fields=[];let titles=[];$(".modal .form > div").each(function(a,b){if($(b).children(".slide_set").length===0&&$(b).children(".aio_upload").length===0){let id=$(b).find(".lbl").attr("for");let label=$(b).find(".lbl").text().replaceAll("*","").replaceAll("Code","");titles.push(label);fields.push({label:label,id:id})}});let form_title=$(this).parent().parent(".modal").find("h2.title:nth-child(1)").text().replaceAll("Add ","");let prompt="Filling form to add "+form_title+", suggest me realistic text to fill each of "+titles.join(",")+". Respond as single array without commentary.";console.log(prompt);$.ajax({type:"POST",url:location.origin+"/google_gemini",data:{prompt:prompt},success:function(a){console.log(a);a=a.replaceAll("```","").replaceAll("json","");a=JSON.parse(a);console.log(a);if(Array.isArray(a)){$.each(fields,function(b,c){$("#"+c.id).val(a[b])})}}})})});